// Helper function to create SVG component
export const createSVGIcon = (iconKey, size = 16, color = 'currentColor') => {
  const icon = techIcons[iconKey];
  if (!icon || !icon.svg) {
    return techIcons.file.svg;
  }
  
  // Parse and modify SVG to add size and color
  const svgContent = icon.svg.replace(/<!--.*?-->/gs, '').trim();
  const modifiedSVG = svgContent
    .replace(/width="[^"]*"/, `width="${size}"`)
    .replace(/height="[^"]*"/, `height="${size}"`)
    .replace(/fill="[^"]*"/g, `fill="${color}"`);
    
  return modifiedSVG;
};